import React from 'react';

import HeaderNav from './pages/sections/HeaderNav';


class Header extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
    };
    this.handleLogOut = this.handleLogOut.bind(this);
  }
  handleLogOut = () => {
    console.log(this.props.loggedIn);

    // console.log('ok');

  }



  render() {
    return (
      <div>

        {this.props.loggedIn ? <HeaderNav handleLogOut={this.handleLogOut} /> : null}
      </div>
    );
  }
}

export default Header
